original_question:
ત્રિકોણ $ABC$ સમદ્વિભાજી છે, જેમાં $AB=AC$ અને ઊંચાઈ $AM=11.$ માનીએ કે $\overline{AM}$ પર એક બિંદુ $D$ છે, જેમાં $AD=10$ અને $\angle BDC=3\angle BAC.$ ત્રિકોણ $ABC$ ની પરિમિતિ શોધો.

[asy]
unitsize(0.4 cm);

pair A, B, C, D, M;

A = (0,11);
D = (0,1);
B = (-11/2,0);
C = (11/2,0);
M = (B + C)/2;

draw(A--B--C--cycle);
draw(A--M);
draw(B--D--C);

label("$A$", A, N);
label("$B$", B, SW);
label("$C$", C, SE);
label("$D$", D, NW);
label("$M$", M, S);
[/asy]

